मान लें कि $f$ को निम्नलिखित रूप में परिभाषित किया गया है \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{ यदि } x \leq 3, \\
-x^3+2x^2+3x & \text{ यदि } x>3.
\end{array}
\right.\] $f^{-1}(0)+f^{-1}(6)$ की गणना करें।

